const countriesList = (data) => {
    return ( 
        <div className="container">
            {
                data.map((country, idx)=>(
                    <div className="country-name" key={idx}>
                        {country.name}
                    </div>
                ))
            }
        </div>
     );
}
 
export default countriesList;
